func TestUnknownBlockFunctions(t *testing.T) {

	block := spec.Block{}

	assert.Panics(t, func() { block.BaseFeePerGas() })
	assert.Panics(t, func() { block.Difficulty() })
	assert.Panics(t, func() { block.ExtraData() })
	assert.Panics(t, func() { block.FeeRecipient() })
	assert.Panics(t, func() { block.GasLimit() })
	assert.Panics(t, func() { block.GasUsed() })
	assert.Panics(t, func() { block.Hash() })
	assert.Panics(t, func() { block.LogsBloom() })
	assert.Panics(t, func() { block.Miner() })
	assert.Panics(t, func() { block.MixHash() })
	assert.Panics(t, func() { block.Nonce() })
	assert.Panics(t, func() { block.Number() })
	assert.Panics(t, func() { block.ParentHash() })
	assert.Panics(t, func() { block.ReceiptsRoot() })
	assert.Panics(t, func() { block.SHA3Uncles() })
	assert.Panics(t, func() { block.Size() })
	assert.Panics(t, func() { block.StateRoot() })
	assert.Panics(t, func() { block.Timestamp() })
	assert.Panics(t, func() { block.TotalDifficulty() })
	assert.Panics(t, func() { block.Transactions() })
	assert.Panics(t, func() { block.TransactionsRoot() })
	assert.Panics(t, func() { block.Uncles() })
}
